import React from 'react';

import {
  Container,
  ContentContainer,
  TitleContainer,
  SubTitle,
  ImageContainer,
} from './styles';

const Project: React.FC = () => {
  return (
    <Container>
      <ContentContainer>
        <TitleContainer>Projects</TitleContainer>
        <ImageContainer></ImageContainer>
      </ContentContainer>
    </Container>
  );
};

export default Project;
